import qz from 'qz-tray';
import { sha256 } from 'js-sha256';

qz.api.setSha256Type(data => sha256(data));
qz.api.setPromiseType(resolver => new Promise(resolver));

// Cole seu Logo Base64 aqui dentro das aspas (Opcional)
const LOGO_BASE64 = "data:image/png;base64,"; 

export const PrinterService = {
  async connect() {
    if (!qz.websocket.isActive()) {
      try {
        await qz.websocket.connect();
        qz.websocket.setClosedCallbacks((evt) => console.log(" QZ Tray desconectado", evt));
      } catch (err) {
        console.error("Erro QZ:", err);
        throw new Error("QZ Tray no detectado.");
      }
    }
  },

  async getPrinterConfig() {
    await this.connect();
    let printerName;
    try { printerName = await qz.printers.getDefault(); } catch (err) { console.warn(err); }
    
    if (!printerName) {
        const printers = await qz.printers.find();
        if (printers.length > 0) printerName = printers[0];
    }

    if (!printerName) throw new Error("Nenhuma impressora instalada no Windows.");
    return qz.configs.create(printerName);
  },

  // --- 1. TICKET DE PRODUO (Cozinha/Bar) ---
  async printSectorTicket(order, items, sectorName) {
    const config = await this.getPrinterConfig();

    const itemsHtml = items.map(item => {
        const name = item.product?.name || item.product_name || 'Item sem nome';
        const obs = item.observation ? `<div style="font-size: 12px; font-style: italic;">Obs: ${item.observation}</div>` : '';
        return `
          <tr style="border-bottom: 1px solid #eee;">
            <td style="font-size: 16px; font-weight: bold; padding: 5px 0; width: 30px; vertical-align: top;">${item.quantity}x</td>
            <td style="font-size: 14px; font-weight: bold; padding: 5px 0; word-wrap: break-word; white-space: pre-wrap;">
                ${name}
                ${obs}
            </td>
          </tr>
        `;
    }).join('');

    const displayId = order.display_id || (typeof order.id === 'string' ? order.id.slice(0,4) : order.id);
    const identifier = order.table_number ? `MESA ${order.table_number}` : (order.channel === 'IFOOD' ? `IFOOD #${displayId}` : `BALCO #${displayId}`);

    const printData = [
      {
        type: 'html',
        format: 'plain',
        data: `
          <div style="font-family: 'Arial', monospace; width: 300px; padding-bottom: 20px;">
            <div style="text-align: center; margin-bottom: 10px;">
              <h1 style="font-size: 24px; font-weight: 900; margin: 0; text-transform: uppercase;">${sectorName}</h1>
              <p style="font-size: 18px; font-weight: bold; margin: 5px 0;">${identifier}</p>
              <p style="font-size: 12px; margin: 0;">${new Date().toLocaleString()}</p>
              <p style="font-size: 12px; margin: 0; font-weight: bold;">${order.customer_name?.slice(0,30) || 'Cliente'}</p>
              ${order.waiter_name ? `<p style="font-size: 12px; margin: 0;">Garom: ${order.waiter_name}</p>` : ''}
            </div>
            <div style="border-top: 2px dashed #000; margin: 5px 0;"></div>
            <table style="width: 100%; border-collapse: collapse;">
              ${itemsHtml}
            </table>
            <div style="border-top: 2px dashed #000; margin: 10px 0;"></div>
          </div>
        `
      }
    ];

    await qz.print(config, printData);
  },

  // --- 2. TICKET DE EXPEDIO (Caixa/Motoboy) ---
  async printExpeditionTicket(order) {
    const config = await this.getPrinterConfig();

    const itemsHtml = order.sale_items.map(item => {
        const name = item.product?.name || item.product_name || 'Item';
        return `
          <tr>
            <td style="padding: 4px 0; font-size: 12px; font-weight: bold; width: 30px; vertical-align: top;">${item.quantity}x</td>
            <td style="padding: 4px 0; font-size: 12px; word-wrap: break-word; white-space: pre-wrap;">${name}</td>
            <td style="text-align: right; font-size: 12px; vertical-align: top;">R$ ${(item.unit_price * item.quantity).toFixed(2)}</td>
          </tr>
        `;
    }).join('');

    const logoHtml = LOGO_BASE64 ? `<img src="${LOGO_BASE64}" style="max-width: 90px; margin-bottom: 5px;" /><br/>` : '';
    const displayId = order.display_id || (typeof order.id === 'string' ? order.id.slice(0,4) : order.id);
    const address = order.delivery_address || order.customer_address || "Endereo no informado / Balco";

    const printData = [
      {
        type: 'html',
        format: 'plain',
        data: `
          <div style="font-family: 'Arial', monospace; font-size: 12px; width: 300px; padding-bottom: 40px;">
            <div style="text-align: center; margin-bottom: 10px;">
              ${logoHtml}
              <h2 style="font-size: 18px; font-weight: bold; margin: 0;">EXPEDIO / ENTREGA</h2>
              <h1 style="font-size: 24px; font-weight: 900; margin: 5px 0;">IFOOD #${displayId}</h1>
              <p style="margin: 0;">${new Date().toLocaleString()}</p>
            </div>
            
            <div style="border: 2px solid #000; padding: 5px; margin: 10px 0; border-radius: 5px;">
              <p style="margin:0; font-weight:bold; font-size: 14px;">${order.customer_name || 'Cliente'}</p>
              <p style="margin:5px 0 0 0; font-size: 12px; word-wrap: break-word;">${address}</p>
            </div>

            <table style="width: 100%; border-collapse: collapse; margin-bottom: 10px;">
              <thead>
                <tr style="border-bottom: 1px solid #000;">
                  <th style="text-align: left;">Qtd</th>
                  <th style="text-align: left;">Item</th>
                  <th style="text-align: right;">Total</th>
                </tr>
              </thead>
              <tbody>
                ${itemsHtml}
              </tbody>
            </table>

            <div style="text-align: right; font-size: 14px; font-weight: bold; margin-top: 10px;">
               TOTAL: R$ ${Number(order.total).toFixed(2)}
            </div>
            <div style="text-align: center; margin-top: 20px;">
              <p style="font-size: 10px;">Conferido por: _________________</p>
            </div>
          </div>
        `
      }
    ];

    await qz.print(config, printData);
  },

  // --- 3. TICKET DO CLIENTE / PR-CONTA (Atualizado: Stacking + Layout ERP + Rodap) ---
  async printCustomerReceipt(order, company = null) {
    const config = await this.getPrinterConfig();

    const rawItems = order.sale_items || order.items || [];
    
    // --- LGICA DE AGRUPAMENTO (STACKING) ---
    const groupedItems = [];
    rawItems.forEach(item => {
        // Normaliza dados (suporta estrutura do banco ou do carrinho)
        const id = item.product_id || item.product?.id;
        const name = item.product?.name || item.product_name || 'Item';
        const price = Number(item.unit_price || item.product?.price || 0);
        const qty = Number(item.quantity || 0);

        if (price < 0) return; // Ignora itens de desconto/servio antigos para no duplicar

        // Procura item existente na lista agrupada (mesmo ID e Preo)
        const existing = groupedItems.find(g => g.id === id && Math.abs(g.price - price) < 0.01);

        if (existing) {
            existing.quantity += qty;
        } else {
            groupedItems.push({ id, name, price, quantity: qty });
        }
    });

    const itemsHtml = groupedItems.map(item => {
        const total = item.price * item.quantity;
        return `
          <tr>
            <td style="padding: 2px 0; word-wrap: break-word; white-space: pre-wrap; padding-right: 5px;">${item.name}</td>
            <td style="text-align: center; padding: 2px 0; vertical-align: top;">${item.quantity}</td>
            <td style="text-align: right; padding: 2px 0; vertical-align: top;">${total.toFixed(2)}</td>
          </tr>
        `;
    }).join('');

    const logoHtml = LOGO_BASE64 ? `<img src="${LOGO_BASE64}" style="max-width: 90px; margin-bottom: 5px;" /><br/>` : '';
    const displayId = order.display_id || (typeof order.id === 'string' ? String(order.id).slice(0,4) : String(order.id));

    // Cabealho da Empresa
    const companyHeader = company ? `
        <h2 style="font-size: 15px; font-weight: bold; margin: 0; text-transform: uppercase;">${company.company_name || 'HAWK VISION'}</h2>
        <p style="margin:0; font-size: 11px;">CNPJ: ${company.cnpj || '00.000.000/0000-00'}</p>
        <p style="margin:0; font-size: 11px;">${company.address || ''} ${company.city ? `- ${company.city}` : ''}</p>
        ${company.cep ? `<p style="margin:0; font-size: 11px;">CEP: ${company.cep}</p>` : ''}
    ` : `<h2 style="font-size: 16px; font-weight: bold; margin: 0;">HAWK VISION</h2>`;

    // Totais (Recebidos calculados ou fallback)
    const subtotal = order.subtotal_value !== undefined ? order.subtotal_value : Number(order.total);
    const serviceFee = order.service_fee_value || 0;
    const discount = order.discount_value || 0;
    const finalTotal = order.total_value !== undefined ? order.total_value : Number(order.total);
    
    // Diviso por Pessoa
    const people = order.people_count && order.people_count > 0 ? order.people_count : 1;
    const perPerson = finalTotal / people;

    const printData = [
      {
        type: 'html',
        format: 'plain',
        data: `
          <div style="font-family: 'Courier New', Courier, monospace; font-size: 12px; width: 300px; padding-bottom: 40px;">
            
            <div style="text-align: center; margin-bottom: 10px;">
              ${logoHtml}
              ${companyHeader}
              <p style="margin-top: 5px; font-size: 11px;">${new Date().toLocaleString()}</p>
            </div>

            <div style="text-align: center; border: 1px solid #000; padding: 5px; margin: 5px 0; font-weight: bold; font-size: 14px;">
                PR-CONTA / CONFERNCIA
            </div>

            <div style="margin-bottom: 5px; font-size: 11px;">
              <strong>PEDIDO: #${displayId}</strong><br/>
              <strong>MESA:</strong> ${order.table_number || 'BALCO'}<br/>
              <strong>CLIENTE:</strong> ${order.customer_name || 'Consumidor'}<br/>
              ${order.waiter_name ? `<strong>ATENDENTE:</strong> ${order.waiter_name.split(' ')[0]}<br/>` : ''}
            </div>

            <div style="border-bottom: 1px dashed #000; margin: 5px 0;"></div>

            <table style="width: 100%; border-collapse: collapse; font-size: 11px;">
              <thead>
                <tr style="border-bottom: 1px dashed #000;">
                  <th style="text-align: left; width: 60%; padding-bottom: 2px;">ITEM</th>
                  <th style="text-align: center; width: 10%; padding-bottom: 2px;">QTD</th>
                  <th style="text-align: right; width: 30%; padding-bottom: 2px;">TOTAL</th>
                </tr>
              </thead>
              <tbody>
                ${itemsHtml}
              </tbody>
            </table>

            <div style="border-top: 1px dashed #000; margin-top: 5px; padding-top: 5px;"></div>

            <table style="width: 100%; font-size: 12px; font-weight: bold;">
                <tr>
                    <td style="text-align: left;">SUBTOTAL</td>
                    <td style="text-align: right;">R$ ${subtotal.toFixed(2)}</td>
                </tr>
                ${serviceFee > 0 ? `
                <tr>
                    <td style="text-align: left;">SERVIO (10%)</td>
                    <td style="text-align: right;">R$ ${serviceFee.toFixed(2)}</td>
                </tr>
                ` : ''}
                ${discount > 0 ? `
                <tr>
                    <td style="text-align: left;">DESCONTO</td>
                    <td style="text-align: right;">- R$ ${discount.toFixed(2)}</td>
                </tr>
                ` : ''}
            </table>

            <div style="border-top: 1px solid #000; margin-top: 5px; padding-top: 5px;">
              <div style="display: flex; justify-content: space-between; font-size: 16px; font-weight: 900;">
                <span>TOTAL</span>
                <span>R$ ${finalTotal.toFixed(2)}</span>
              </div>
            </div>

            ${people > 1 ? `
            <div style="margin-top: 5px; font-size: 11px;">
               <div style="display: flex; justify-content: space-between;">
                  <span>PESSOAS:</span>
                  <span>${people}</span>
               </div>
               <div style="display: flex; justify-content: space-between; font-weight: bold;">
                  <span>VALOR POR PESSOA:</span>
                  <span>R$ ${perPerson.toFixed(2)}</span>
               </div>
            </div>
            ` : ''}

            <div style="text-align: center; margin-top: 20px; font-size: 10px;">
              <p>*** NO  DOCUMENTO FISCAL ***</p>
              <p>Obrigado pela preferncia!</p>
              <p style="margin-top: 10px; font-weight: bold; font-size: 11px;">HAWK VISION</p>
            </div>
          </div>
        `
      }
    ];

    await qz.print(config, printData);
  },

  // --- 4. RELATRIO Z (FECHAMENTO DE CAIXA) ---
  async printZReport(data) {
    const config = await this.getPrinterConfig();

    const { session, totals, methods, items, cancellations } = data;

    // Formata Moeda
    const f = (val) => val ? Number(val).toLocaleString('pt-BR', { style: 'currency', currency: 'BRL' }) : 'R$ 0,00';

    // HTML dos Mtodos de Pagamento (Conferncia)
    const methodsHtml = Object.entries(methods).map(([name, vals]) => {
        const diff = vals.reported - vals.system;
        return `
          <tr>
            <td style="text-align: left;">${name}</td>
            <td style="text-align: right;">${f(vals.reported)}</td>
            <td style="text-align: right;">${f(vals.system)}</td>
            <td style="text-align: right; font-weight: bold;">${f(diff)}</td>
          </tr>
        `;
    }).join('');

    // HTML dos Itens Vendidos (Curva ABC)
    const itemsHtml = items.map(item => `
        <tr>
            <td style="text-align: left;">${item.quantity}x ${item.name.slice(0, 20)}</td>
            <td style="text-align: right;">${f(item.total)}</td>
        </tr>
    `).join('');

    // HTML Cancelamentos
    const cancelHtml = cancellations.length > 0 ? cancellations.map(c => `
        <tr>
            <td style="text-align: left;">#${c.display_id} - ${c.reason || 'S/ Motivo'}</td>
            <td style="text-align: right;">-${f(c.total)}</td>
        </tr>
    `).join('') : '<tr><td colspan="2" style="text-align:center; font-style:italic;">Nenhum cancelamento</td></tr>';

    const printData = [
      {
        type: 'html',
        format: 'plain',
        data: `
          <div style="font-family: 'Arial', monospace; font-size: 11px; width: 300px; padding-bottom: 40px;">
            
            <div style="text-align: center; margin-bottom: 10px;">
              <h2 style="font-size: 16px; font-weight: bold; margin: 0;">RELATRIO Z</h2>
              <p style="margin: 0;">Sesso #${session.id}</p>
              <p style="margin: 0;">Abertura: ${new Date(session.opened_at).toLocaleString()}</p>
              <p style="margin: 0;">Fechamento: ${new Date().toLocaleString()}</p>
              <p style="margin: 0;">Operador: ${session.employee_name || 'Caixa'}</p>
            </div>
            
            <div style="border-bottom: 1px dashed #000; margin: 5px 0;"></div>

            <h3 style="margin: 5px 0; font-size: 12px; font-weight: bold; background: #eee;">MOVIMENTAO</h3>
            <table style="width: 100%; font-size: 11px;">
                <tr><td>(+) Fundo Inicial:</td><td style="text-align:right;">${f(session.initial_balance)}</td></tr>
                <tr><td>(+) Vendas Brutas:</td><td style="text-align:right;">${f(totals.grossSales)}</td></tr>
                <tr><td>(+) Suprimentos:</td><td style="text-align:right;">${f(totals.supplies)}</td></tr>
                <tr><td>(-) Sangrias:</td><td style="text-align:right;">${f(totals.bleeds)}</td></tr>
                <tr><td>(-) Descontos:</td><td style="text-align:right;">${f(totals.discounts)}</td></tr>
                <tr><td style="font-weight:bold;">(=) ESPERADO EM CAIXA:</td><td style="text-align:right; font-weight:bold;">${f(totals.expectedTotal)}</td></tr>
            </table>

            <div style="border-bottom: 1px dashed #000; margin: 5px 0;"></div>

            <h3 style="margin: 5px 0; font-size: 12px; font-weight: bold; background: #eee;">CONCILIAO</h3>
            <table style="width: 100%; font-size: 10px; border-collapse: collapse;">
                <tr style="border-bottom: 1px solid #000;">
                    <th style="text-align: left;">Mtodo</th>
                    <th style="text-align: right;">Informado</th>
                    <th style="text-align: right;">Sistema</th>
                    <th style="text-align: right;">Dif.</th>
                </tr>
                ${methodsHtml}
            </table>
            
            <div style="margin-top: 5px; text-align: right; font-weight: bold; font-size: 12px;">
                DIFERENA TOTAL: ${f(session.difference)}
            </div>

            <div style="border-bottom: 1px dashed #000; margin: 5px 0;"></div>

            <h3 style="margin: 5px 0; font-size: 12px; font-weight: bold; background: #eee;">VENDAS POR ITEM</h3>
            <table style="width: 100%; font-size: 10px;">
                ${itemsHtml}
            </table>

            <div style="border-bottom: 1px dashed #000; margin: 5px 0;"></div>

            <h3 style="margin: 5px 0; font-size: 12px; font-weight: bold; background: #eee;">CANCELAMENTOS</h3>
            <table style="width: 100%; font-size: 10px;">
                ${cancelHtml}
            </table>

            <div style="text-align: center; margin-top: 30px;">
              <p>_______________________________</p>
              <p>Assinatura do Responsvel</p>
              <p style="margin-top: 10px; font-weight: bold; font-size: 11px;">HAWK VISION</p>
            </div>
          </div>
        `
      }
    ];

    await qz.print(config, printData);
  }
};